	   uint8_t * sram_addr_leave = 0x20011008; // si lascia così com'è
	   uint8_t * sram_addr_reconstructed = 0x20015A00; //si mette un valore di PUF ricostruito
	   int i;
	   int j;
	    /* Initialize system */
	    SystemInit();
	    /* Initialize random number generator */
	        TM_RNG_Init();
	        UB_Led_Init(); // LEDs initialisieren

	        for(i=0;i<16896;i++)
	        {
	        	sram_addr_0[i] = 0x00;
	            sram_addr_1[i] = 0xFF;
	        	sram_addr_reconstructed[i] = ~sram_addr_reconstructed[i]; // o così oppure devo salvare staticamente la PUF nella flash!
	        }


	        for(i=0;i<4224;i++)
	        {

	        	sram_addr_rand_2[i] = TM_RNG_Get();
	        }

	        UB_Led_On(LED_GREEN);
	    	while(1)
	    	{


	    		for(j=0;j<4224;j++) // 21162 -> hex 52AA
	    		{

	    			sram_addr_rand_1[j] = TM_RNG_Get();
	    		}

	    		UB_Led_Toggle(LED_GREEN);
	    		delay(100);

	    	}
