void delay(uint32_t ms) {
        ms *= STM32_CLOCK_HZ / 1000 / STM32_CYCLES_PER_LOOP;

        asm volatile(" mov r0, %[ms] \n\t"
                        "1: subs r0, #1 \n\t"
                        " bhi 1b \n\t"
                        :
                        : [ms] "r" (ms)
                        : "r0");
}
